import React from 'react';
import styled from 'styled-components';
import thumbnail from 'assets/img/thumbnail.png';

const Wrapper = styled.div`

`
const CourseDetails = () => {
    return (
        <Wrapper>
            <section>
                <img src={thumbnail} alt=""/>
            </section>
        </Wrapper>
    );
};

export default CourseDetails;
